import {auth} from '../../firebase-config' 
import {Navigate} from 'react-router-dom'

const ProtectedRoutes = () => {

    const user= auth ;
    if(!user) {
        return <Navigate to = '/signin'/> 
    }

  return (
    <Navigate to = '/home'/>
  )
}

